  `InOrOut` tinyint(4) DEFAULT '1' COMMENT '资金进出1、进账2、支出',
  `isdel` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否撤销',
  `Remark` varchar(100) DEFAULT NULL COMMENT '备注',
  `IP` varchar(255) DEFAULT NULL COMMENT 'IP地址',
  `cdate` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建日期',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=425 DEFAULT CHARSET=utf8;

