-- ----------------------------
-- Procedure structure for P_Auto_Check_Cash_Trade
-- ----------------------------
DROP PROCEDURE IF EXISTS `P_Auto_Check_Cash_Trade`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `P_Auto_Check_Cash_Trade`()
PL:BEGIN
	DECLARE P_Sys_HKQRSJ INT;  #汇款确认时间 小时
	DECLARE P_Sys_SKQRSJ INT;  #收款确认时间 小时

	DECLARE P_SellId BIGINT;
	DECLARE P_SellUserId BIGINT;
	DECLARE P_SellUserName VARCHAR(50);
	DECLARE P_Amount DECIMAL(10,2);
	DECLARE P_BuyId BIGINT;
	DECLARE P_BuyUserId BIGINT;
	DECLARE P_ImgCount INT;  #购买记录上传图片数量
	DECLARE P_Now TIMESTAMP DEFAULT UTC_TIMESTAMP();  #获取当前UTC时间

	DECLARE P_TimeDiff BIGINT DEFAULT 0; #间隔时间 分钟数

	IF(P_Now = CURRENT_TIMESTAMP()) THEN
		SET P_Now = CURRENT_TIMESTAMP();
	END IF;

	SELECT HKQRSJ,SKQRSJ  FROM Shares_Config LIMIT 0,1  INTO P_Sys_HKQRSJ,P_Sys_SKQRSJ;
	SET P_Sys_HKQRSJ = P_Sys_HKQRSJ * 60 ;
	SET P_Sys_SKQRSJ = P_Sys_SKQRSJ * 60 ;

	
	#检查认购用户汇款是否超时
	SELECT MIN(SellId) INTO P_SellId FROM Users_Cash_Sell WHERE `Status` = '2' AND BuyId IS NOT NULL AND BuyUserId IS NOT NULL;
	SET P_SellId = IFNULL(P_SellId,0);
	WHILE (P_SellId > 0 AND P_SellId IS NOT NULL) DO
		SELECT BuyId,BuyUserId FROM Users_Cash_Sell WHERE SellId = P_SellId  INTO P_BuyId,P_BuyUserId;
		SELECT TIMESTAMPDIFF(MINUTE,cdate,P_Now) INTO P_TimeDiff FROM Users_Cash_Buy WHERE BuyId = P_BuyId;
		SET P_TimeDiff = IFNULL(P_TimeDiff,0);

		IF(P_TimeDiff > P_Sys_HKQRSJ) THEN  #允许汇款时间
			UPDATE Users_Cash_Sell SET `Status` = 0,BuyId = NULL,BuyUserId = NULL,bufferDate = P_Now WHERE SellId = P_SellId;
			UPDATE Users_Cash_Buy SET `Status` = 0 WHERE BuyId = P_BuyId;
			CALL P_Shares_Subtract (P_BuyUserId,'汇款上传证明超时');
		END IF;
		SET P_TimeDiff = 0;
		SELECT MIN(SellId) INTO P_SellId FROM Users_Cash_Sell WHERE SellId > P_SellId AND `Status` = '2' AND BuyId IS NOT NULL AND BuyUserId IS NOT NULL;
		SET P_SellId = IFNULL(P_SellId,0);
	END WHILE;

	SET P_BuyUserId = 0;
	

	#检查收款用户收款是否超时
	SELECT MIN(SellId) INTO P_SellId FROM Users_Cash_Sell WHERE `Status` = '3' AND BuyId IS NOT NULL AND BuyUserId IS NOT NULL;
	SET P_SellId = IFNULL(P_SellId,0);
	WHILE (P_SellId > 0 AND P_SellId IS NOT NULL) DO
		
		SELECT BuyId,UserId,BuyUserId,Amount FROM Users_Cash_Sell WHERE SellId = P_SellId  INTO P_BuyId,P_SellUserId,P_BuyUserId,P_Amount;
		SET P_Amount = IFNULL(P_Amount,0);
		SELECT UserName INTO P_SellUserName FROM Users WHERE UserId = P_SellUserId;
		SELECT TIMESTAMPDIFF(MINUTE,PayDate,P_Now) INTO P_TimeDiff FROM Users_Cash_Buy WHERE BuyId = P_BuyId;
		SET P_TimeDiff = IFNULL(P_TimeDiff,0);

		SELECT COUNT(*) INTO P_ImgCount FROM Users_Cash_Buy_Images WHERE BuyId = P_BuyId;

		IF(P_TimeDiff > P_Sys_SKQRSJ  AND P_ImgCount > 0) THEN  #允许收款时间
			VALUES (P_BuyUserId,P_SellUserId,2,7,1,P_Amount,P_Amount,CONCAT('自动确认从:',P_SellUserName,'买入的积分'),P_Now);
			
			UPDATE Users_Asset SET TotalBonus = TotalBonus + P_Amount,BonusSurplus = BonusSurplus + P_Amount WHERE UserId = P_BuyUserId;
			UPDATE Users_Cash_Sell SET `Status` = 4 WHERE SellId = P_SellId;
			UPDATE Users_Cash_Buy SET `Status` = 2 WHERE BuyId = P_BuyId;
			CALL P_Shares_Subtract (P_SellUserId,'收款确认超时');
		END IF;
		
		SET P_TimeDiff = 0;
		SELECT MIN(SellId) INTO P_SellId FROM Users_Cash_Sell WHERE SellId > P_SellId AND `Status` = '3' AND BuyId IS NOT NULL AND BuyUserId IS NOT NULL;
		SET P_SellId = IFNULL(P_SellId,0);
	END WHILE;

	
	 

	#检查卖出用户缓冲时间 
	SELECT MIN(SellId) INTO P_SellId FROM Users_Cash_Sell WHERE `Status` = '0' AND bufferDate IS NOT NULL;
	SET P_SellId = IFNULL(P_SellId,0);
	WHILE (P_SellId > 0 AND P_SellId IS NOT NULL) DO

		SELECT TIMESTAMPDIFF(MINUTE,bufferDate,P_Now) INTO P_TimeDiff FROM Users_Cash_Sell WHERE SellId = P_SellId;
		SET P_TimeDiff = IFNULL(P_TimeDiff,0);

		IF(P_TimeDiff > P_Sys_HKQRSJ ) THEN  #允许汇款时间
			UPDATE Users_Cash_Sell SET `Status` = 1,bufferDate = NULL WHERE SellId = P_SellId;
		END IF;
		
		SET P_TimeDiff = 0;
		SELECT MIN(SellId) INTO P_SellId FROM Users_Cash_Sell WHERE SellId > P_SellId AND `Status` = '0' AND bufferDate IS NOT NULL;
		SET P_SellId = IFNULL(P_SellId,0);
	END WHILE;




END
;;
DELIMITER ;

