-- ----------------------------
-- Procedure structure for P_DelUserId
-- ----------------------------
DROP PROCEDURE IF EXISTS `P_DelUserId`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `P_DelUserId`(IN P_UserId bigint)
PL:BEGIN
	DECLARE P_ParentUserId BIGINT;
	DECLARE P_RefundUserId BIGINT;
	DECLARE P_PayUserId BIGINT;
	DECLARE P_Rid BIGINT; #扣回奖金记录ID
	DECLARE P_UserName varchar(50); #会员用户名
	DECLARE P_PlaceArea INT;
	DECLARE P_RegDate datetime;

	DECLARE P_BonusType INT;
	DECLARE P_CashBonus DECIMAL(10,3);
	DECLARE P_DTFTBonus DECIMAL(10,3);
	DECLARE P_LYJFBonus DECIMAL(10,3);
	DECLARE P_JTFTBonus DECIMAL(10,3);
	DECLARE P_SCJFBonus DECIMAL(10,3);
	DECLARE P_ZCJF DECIMAL(10,3);
	DECLARE P_PayDTFT DECIMAL(10,3); #支付的报单积分金额
	DECLARE P_PayDTFTId BIGINT;
	DECLARE P_PayZCJF DECIMAL(10,3); #支付的注册积分金额
	DECLARE P_Price DECIMAL(10,3); #购买的等级金额

	IF((SELECT COUNT(*) FROM Users WHERE UserId = P_UserId) = 0) THEN
		LEAVE PL ;  #跳出执行存储过程
	END IF;

	IF((SELECT COUNT(*) FROM Users WHERE ParentUserId = P_UserId) > 0) THEN
		LEAVE PL ;  #跳出执行存储过程
	END IF;

	IF((SELECT COUNT(*) FROM Users WHERE RecommendUserId = P_UserId) > 0) THEN
		LEAVE PL ;  #跳出执行存储过程
	END IF;

	SELECT FromUserId INTO P_PayUserId FROM Users_Bonus WHERE UserId = P_UserId AND InOrOut = 1 ORDER BY Id DESC LIMIT 0,1;
	IF(P_PayUserId IS NULL OR P_PayUserId = 0) THEN
		LEAVE PL ;  #跳出执行存储过程
	END IF;

	SELECT UserName,ParentUserId,PlaceArea,RegDate FROM Users WHERE UserId = P_UserId INTO P_UserName,P_ParentUserId,P_PlaceArea,P_RegDate;
	SET P_ParentUserId = IFNULL(P_ParentUserId,0);

	SELECT Price INTO P_Price FROM Net_Users WHERE UserId = P_UserId  ORDER BY NetUserId DESC LIMIT 0,1;
	SET P_Price = IFNULL(P_Price,0);

	BEGIN#扣除相应奖金
		SELECT MIN(Id) INTO P_Rid FROM Users_Bonus WHERE FromUserId = P_UserId AND InOrOut = 1;
		SET P_Rid = IFNULL(P_Rid,0);
		WHILE (P_Rid > 0 AND P_Rid IS NOT NULL) DO
			SELECT UserId,BonusType,CashBonus,DTFTBonus,LYJFBonus,JTFTBonus,SCJFBonus FROM Users_Bonus WHERE Id = P_Rid 
			INTO P_RefundUserId,P_BonusType,P_CashBonus,P_DTFTBonus,P_LYJFBonus,P_JTFTBonus,P_SCJFBonus;
			SET P_BonusType = IFNULL(P_BonusType,0);
			SET P_CashBonus = IFNULL(P_CashBonus,0);
			SET P_DTFTBonus = IFNULL(P_DTFTBonus,0);
			SET P_LYJFBonus = IFNULL(P_LYJFBonus,0);
			SET P_SCJFBonus = IFNULL(P_SCJFBonus,0);

			#更新账户余额
			UPDATE Users_Asset 
			SET TotalBonus = TotalBonus - P_CashBonus ,BonusSurplus = BonusSurplus - P_CashBonus , DTFTJJ = DTFTJJ - P_DTFTBonus , DTFTJJYE = DTFTJJYE - P_DTFTBonus
					, LYJF = LYJF - P_LYJFBonus , LYJFYE = LYJFYE - P_LYJFBonus , SCJF = SCJF - P_SCJFBonus , SCJFYE = SCJFYE - P_SCJFBonus
			WHERE UserId = P_RefundUserId;

			#更新每日统计
			UPDATE Shares_Statistics SET DTBonus = DTBonus - P_CashBonus,DTFT = DTFT - P_DTFTBonus,DTLY = DTLY - P_LYJFBonus WHERE to_days(cdate) = to_days(P_RegDate);

			#IF(P_BonusType = 2) THEN
				
			#END IF

			SELECT MIN(Id) INTO P_Rid FROM Users_Bonus WHERE FromUserId = P_UserId AND Id > P_Rid  AND InOrOut = 1;
			SET P_Rid = IFNULL(P_Rid,0);
			SET P_CashBonus = 0;
			SET P_DTFTBonus = 0;
			SET P_LYJFBonus = 0;
			SET P_SCJFBonus = 0;
		END WHILE;
		DELETE FROM Users_Bonus WHERE FromUserId = P_UserId AND InOrOut = 1 AND BonusType <> 2;#删除相应奖金记录除平衡奖以外
	END;

	BEGIN #返还注册人注册积分及报单积分
		#支出的报单积分
		SELECT Id,DTFTBonus FROM Users_Bonus WHERE UserId = P_PayUserId AND FromUserId = P_PayUserId AND Remark LIKE CONCAT('%',P_UserName) ORDER BY Id DESC LIMIT 0,1 INTO P_PayDTFTId,P_PayDTFT;
		SET P_PayDTFTId = IFNULL(P_PayDTFTId,0);
		SET P_PayDTFT = IFNULL(P_PayDTFT,0);
		#支出的注册积分
		SELECT Amount INTO P_PayZCJF FROM Users_ZCJF WHERE UserId = P_PayUserId AND FromUserId = P_UserId;
		SET P_PayZCJF = IFNULL(P_PayZCJF,0);

		UPDATE Users_Asset SET DTFTJJYE = DTFTJJYE + P_PayDTFT,ZCJFYYE = ZCJFYYE + P_PayZCJF WHERE UserId = P_PayUserId;
		IF(P_PayDTFTId > 0) THEN
			DELETE FROM Users_Bonus WHERE Id = P_PayDTFTId;
		END IF;
		DELETE FROM Users_Bonus WHERE UserId = P_UserId AND FromUserId = P_PayUserId;
		DELETE FROM Users_ZCJF WHERE UserId = P_PayUserId AND FromUserId = P_UserId;
	END;
	
	BEGIN #扣除相应统计
		WHILE (P_ParentUserId > 0 AND P_ParentUserId IS NOT NULL) DO
			IF (P_PlaceArea = 0) THEN
				UPDATE Users_Asset SET TeamNum = TeamNum - 1,TeamTurnover = TeamTurnover - P_Price,LeftTotalTurnover = LeftTotalTurnover - P_Price,LeftTurnoverSurplus = LeftTurnoverSurplus - P_Price WHERE UserId = P_ParentUserId;
				IF( (SELECT IFNULL(LeftTurnoverSurplus,0) FROM Users_Asset WHERE UserId = P_ParentUserId) < 0 ) THEN
					UPDATE Users_Asset SET LeftTurnoverSurplus = 0 WHERE UserId = P_ParentUserId;
				END IF;
				IF((SELECT COUNT(*) FROM Users_Bonus WHERE UserId = P_ParentUserId AND FromUserId = P_UserId AND BonusType = 2) > 0) THEN
					UPDATE Users_Asset SET RightTurnoverSurplus = RightTurnoverSurplus + P_Price WHERE UserId = P_ParentUserId;
				END IF;
			ELSE
				UPDATE Users_Asset SET TeamNum = TeamNum - 1,TeamTurnover = TeamTurnover - P_Price,RightTotalTurnover = RightTotalTurnover - P_Price,RightTurnoverSurplus = RightTurnoverSurplus - P_Price WHERE UserId = P_ParentUserId;
				IF( (SELECT IFNULL(RightTurnoverSurplus,0) FROM Users_Asset WHERE UserId = P_ParentUserId) < 0 ) THEN
					UPDATE Users_Asset SET RightTurnoverSurplus = 0 WHERE UserId = P_ParentUserId;
				END IF;
				IF((SELECT COUNT(*) FROM Users_Bonus WHERE UserId = P_ParentUserId AND FromUserId = P_UserId AND BonusType = 2) > 0) THEN
					UPDATE Users_Asset SET LeftTurnoverSurplus = LeftTurnoverSurplus + P_Price WHERE UserId = P_ParentUserId;
				END IF;
			END IF;

			DELETE FROM Users_Bonus WHERE UserId = P_ParentUserId AND FromUserId = P_UserId AND BonusType = 2; #删除用于计算左右区业绩的平衡奖记录

			SELECT ParentUserId,PlaceArea FROM Users WHERE UserId = P_ParentUserId INTO P_ParentUserId,P_PlaceArea;
			SET P_ParentUserId = IFNULL(P_ParentUserId,0);
		END WHILE;

		UPDATE Shares_Statistics SET TotalProfit = TotalProfit + P_Price WHERE to_days(cdate) = to_days(P_RegDate);  #更新每日新报业绩

	END;

	BEGIN #删除会员相应资料
		DELETE FROM Shares WHERE UserId = P_UserId;
		DELETE FROM Shares_Buy WHERE UserId = P_UserId;
		DELETE FROM Shares_Sell WHERE UserId = P_UserId;
		DELETE FROM Users_Cash_Buy WHERE UserId = P_UserId;
		DELETE FROM Users_Cash_Sell WHERE UserId = P_UserId;
		DELETE FROM Users_Profile WHERE UserId = P_UserId;
		DELETE FROM Users_ZCJF WHERE UserId = P_UserId;
		DELETE FROM Users_Asset WHERE UserId = P_UserId;
		DELETE FROM Users_Accounts WHERE UserId = P_UserId OR clientUserId = P_UserId;
		DELETE FROM login_log WHERE user_id = P_UserId;
		DELETE FROM performance WHERE user_id = P_UserId;
		DELETE FROM Orders WHERE PayUserId = P_UserId;
		DELETE FROM Users WHERE UserId = P_UserId;
		DELETE FROM Net_Users WHERE UserId = P_UserId;
	END;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for P_GetParentUserIds
-- ----------------------------
DROP PROCEDURE IF EXISTS `P_GetParentUserIds`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `P_GetParentUserIds`(IN P_UserId bigint)
PL:BEGIN


	DECLARE UserIds VARCHAR(9999);
	DECLARE tmpUserId VARCHAR(1000);

	SET UserIds = '';
	SET tmpUserId =cast(P_UserId as CHAR);

	WHILE tmpUserId is not null DO
		SET UserIds = concat(UserIds,',',tmpUserId);
		SELECT group_concat(ParentUserId) INTO tmpUserId FROM Users where ParentUserId<>UserId and FIND_IN_SET(UserId,tmpUserId)>0;
	END WHILE;
	#RETURN sTemp;

	SET UserIds = SUBSTRING(UserIds,2);  #第3个字符开始取值

	SELECT UserIds AS UserIds;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for P_GetTodaySharePrice
-- ----------------------------
DROP PROCEDURE IF EXISTS `P_GetTodaySharePrice`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `P_GetTodaySharePrice`()
BEGIN
	DECLARE P_CurPrice decimal(10,3);  #当前价
	DECLARE P_OpenPrice decimal(10,3);    #开盘价
	DECLARE P_MaxPrice decimal(10,3);    #最高价
	DECLARE P_MinPrice decimal(10,3);    #最低价
	DECLARE P_Increase decimal(10,3);    #增幅
	DECLARE P_Now TIMESTAMP DEFAULT UTC_TIMESTAMP();  #获取当前UTC时间
	DECLARE P_cdate TIMESTAMP DEFAULT UTC_TIMESTAMP();

	DECLARE P_MaxId INT;

	SELECT MAX(Id)  INTO P_MaxId  FROM Shares_Price;
	SELECT Price INTO P_CurPrice  FROM Shares_Price WHERE Id = P_MaxId;
	SET P_CurPrice = IFNULL(P_CurPrice,0);

	#SELECT P_CurPrice,P_MaxId;

	IF(P_CurPrice = 0) THEN
			SELECT InitialPrice INTO P_CurPrice FROM Shares_Config LIMIT 0,1;
			SET P_OpenPrice = P_CurPrice;
			SET P_MaxPrice = P_CurPrice;
			SET P_MinPrice = P_CurPrice;
			SET P_Increase = 0;
	ELSE
			SELECT Price INTO P_OpenPrice FROM Shares_Price WHERE to_days(cdate) = to_days(P_Now) ORDER BY Id ASC LIMIT 0,1 ;
			SET P_OpenPrice = IFNULL(P_OpenPrice,0);
			IF(P_OpenPrice = 0) THEN
				SET P_OpenPrice = P_CurPrice;
				SET P_MaxPrice = P_CurPrice;
				SET P_MinPrice = P_CurPrice;
				SET P_Increase = 0;
			ELSE
				SET P_MaxPrice = P_CurPrice;
				SET P_MinPrice = P_OpenPrice;
				SET P_Increase = P_CurPrice - P_OpenPrice;
			END IF;
	END IF;

	#DROP TABLE IF EXISTS t;

	#CREATE TEMPORARY TABLE t (Name varchar(20), Price decimal(10,3) ,Sort INT);  #临时表
	
	SELECT '今日最低' AS Name, P_OpenPrice AS Price,1 AS Sort
	UNION
	SELECT '今日最高' AS Name, P_MaxPrice AS Price,2 AS Sort
	UNION
	SELECT '当前时价' AS Name, P_CurPrice AS Price,3 AS Sort
	UNION
	SELECT '今日涨幅' AS Name, P_Increase AS Price,4 AS Sort;


	/*
	INSERT t(Name,Price,Sort) VALUES ('今日最低',P_OpenPrice,1);
	INSERT t(Name,Price,Sort) VALUES ('今日最高',P_MaxPrice,2);
	INSERT t(Name,Price,Sort) VALUES ('当前时价',P_CurPrice,3);
	INSERT t(Name,Price,Sort) VALUES ('今日涨幅',P_Increase,4);

	SELECT * FROM t ORDER BY Sort ASC;
	
	TRUNCATE t;
*/

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for P_GetTransferUserIds
-- ----------------------------
DROP PROCEDURE IF EXISTS `P_GetTransferUserIds`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `P_GetTransferUserIds`(IN P_UserId bigint, IN P_InUserId bigint)
PL:BEGIN


	DECLARE UserIds VARCHAR(9999);
	DECLARE tmpUserId VARCHAR(1000);
	DECLARE P_IsService INT DEFAULT 0;
	DECLARE P_InUserIsService INT DEFAULT 0;  #转入用户是否为服务站
	DECLARE P_IdCardUserId BIGINT DEFAULT 0;  #转入用户同身份证UserId
	DECLARE P_IdCard VARCHAR(100);

	SET P_UserId = IFNULL(P_UserId,0);
	
	SELECT IsService INTO P_IsService FROM Users WHERE UserId = P_UserId;
	SET P_IsService = IFNULL(P_IsService,0);
	
	SET UserIds = '';

	IF (P_IsService = 1) THEN  #如转出账户是服务站

		#转入账户父级用户ID
		SET tmpUserId =cast(P_InUserId as CHAR);
		WHILE tmpUserId is not null DO
			SET UserIds = concat(UserIds,',',tmpUserId);

			SELECT group_concat(ParentUserId) INTO tmpUserId FROM Users where ParentUserId<>UserId and FIND_IN_SET(UserId,tmpUserId)>0;
		END WHILE;

		#同身份证用户ID
		SELECT IdCard INTO P_IdCard FROM Users_Profile WHERE UserId = P_UserId;

		SELECT MIN(UserId) INTO P_IdCardUserId FROM Users_Profile WHERE IdCard = P_IdCard AND UserId <> P_UserId AND IdCard IS NOT NULL;
		SET P_IdCardUserId = IFNULL(P_IdCardUserId,0);
		WHILE (P_IdCardUserId > 0 ) DO
			SET UserIds = concat(UserIds,',',P_IdCardUserId);

			SELECT MIN(UserId) INTO P_IdCardUserId FROM Users_Profile WHERE UserId > P_IdCardUserId AND IdCard = P_IdCard AND UserId <> P_UserId AND IdCard IS NOT NULL;
			SET P_IdCardUserId = IFNULL(P_IdCardUserId,0);
		END WHILE;


		SET tmpUserId = NULL;
	ELSE
		
		
		#父级用户为服务站的UserID
		SET tmpUserId =cast(P_UserId as CHAR);
		WHILE tmpUserId is not null DO
			SELECT IsService INTO P_IsService FROM Users WHERE UserId = tmpUserId;
			SET P_IsService = IFNULL(P_IsService,0);
			IF (P_IsService = 1) THEN 
				SET UserIds = concat(UserIds,',',tmpUserId);
			END IF;

			SELECT group_concat(ParentUserId) INTO tmpUserId FROM Users where ParentUserId<>UserId and FIND_IN_SET(UserId,tmpUserId)>0;
		END WHILE;

		#同身份证用户ID
		SELECT IdCard INTO P_IdCard FROM Users_Profile WHERE UserId = P_UserId;

		SELECT MIN(UserId) INTO P_IdCardUserId FROM Users_Profile WHERE IdCard = P_IdCard AND UserId <> P_UserId AND IdCard IS NOT NULL;
		SET P_IdCardUserId = IFNULL(P_IdCardUserId,0);
		WHILE (P_IdCardUserId > 0 ) DO

			SET UserIds = concat(UserIds,',',P_IdCardUserId);

			SELECT MIN(UserId) INTO P_IdCardUserId FROM Users_Profile WHERE UserId > P_IdCardUserId AND IdCard = P_IdCard AND UserId <> P_UserId AND IdCard IS NOT NULL;
			SET P_IdCardUserId = IFNULL(P_IdCardUserId,0);
		END WHILE;

		#RETURN sTemp;
	END IF;

	IF(UserIds <> '') THEN
		SET UserIds = SUBSTRING(UserIds,2);  #第3个字符开始取值
	ELSE
		SET UserIds = '0';
	END IF;

	

	SELECT UserIds AS UserIds;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for P_GetUserCanSellShares
-- ----------------------------
DROP PROCEDURE IF EXISTS `P_GetUserCanSellShares`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `P_GetUserCanSellShares`(IN P_UserId bigint)
PL:BEGIN
	DECLARE P_Sys_InitialPrice decimal(10,3);  #初始价格
	DECLARE P_Sys_UnitShares BIGINT;    #单位价格股数

	DECLARE P_NetUserId BIGINT;
	DECLARE P_ProductId INT;
	DECLARE P_LastSalePrice decimal(10,3); 

	DECLARE P_KMGS INT;  #相应等级每10个价位最大可卖股数

	DECLARE P_PriceId  BIGINT; 
	DECLARE P_CurPrice  decimal(10,3) ; 

	DECLARE P_CanSellShares INT DEFAULT 0;  #可交易股数
	DECLARE P_SurplusShares INT DEFAULT 0;  #结余股数
	DECLARE P_TradeSurplusShares INT DEFAULT 0;  #可交易结余股数

	DECLARE P_SharesCount INT DEFAULT 0; #返回的可售股数
	DECLARE P_TotalShares INT DEFAULT 0; #返回总的持有股数

	DECLARE P_Now TIMESTAMP DEFAULT UTC_TIMESTAMP();  #获取当前UTC时间

	SELECT InitialPrice,UnitShares  FROM Shares_Config LIMIT 0,1 INTO P_Sys_InitialPrice,P_Sys_UnitShares;

	#不存在股权价格记录则新增初始价格
	IF((SELECT COUNT(*) FROM Shares_Price) = 0) THEN
	END IF;

	SELECT MAX(Id) INTO P_PriceId FROM Shares_Price;
	SELECT Price INTO P_CurPrice FROM Shares_Price  WHERE Id = P_PriceId;


	SELECT MAX(NetUserId),ProductId, LastSalePrice FROM Net_Users WHERE UserId = P_UserId AND IsOut = 0 INTO P_NetUserId,P_ProductId,P_LastSalePrice;
	SET P_NetUserId = IFNULL(P_NetUserId,0);
	SET P_LastSalePrice = IFNULL(P_LastSalePrice,0);
	SET P_ProductId = IFNULL(P_ProductId,0);
	
	IF(P_ProductId > 0) THEN
		SELECT KMGS INTO P_KMGS FROM Products WHERE ProductId = P_ProductId;
	END IF;
	SET P_KMGS = IFNULL(P_KMGS,0);

	#SELECT P_UserId ,P_NetUserId,P_ProductId, P_LastSalePrice,P_CurPrice,P_KMGS;

	SELECT SUM(Shares - OutShares) INTO P_SurplusShares FROM Shares WHERE UserId = P_UserId AND (Shares - OutShares) > 0;
	SET P_SurplusShares = IFNULL(P_SurplusShares,0);
	SET P_TotalShares = P_TotalShares + P_SurplusShares;


	#SELECT SUM(Shares - OutShares) INTO P_CanSellShares FROM Shares 
	#WHERE UserId = P_UserId AND ShareType = 1 AND (Shares - OutShares) > 0 AND (LastSalePrice = 0 OR (P_CurPrice - LastSalePrice) >= 0.01 );
	SET P_CanSellShares = P_SurplusShares;

	IF( P_CanSellShares  > P_KMGS) THEN
		SET P_SharesCount = P_KMGS;
	ELSE
		SET P_SharesCount = P_CanSellShares;
	END IF;

	IF((P_CurPrice - P_LastSalePrice) < 0.01 AND P_CurPrice >= P_LastSalePrice) THEN
		SET P_SharesCount = 0;
	END IF;




	SELECT  P_SharesCount AS CanSellShares, P_TotalShares AS TotalShares;


END
;;
DELIMITER ;

