	DECLARE P_TotalShares INT DEFAULT 0; #返回总的持有股数

	DECLARE P_Now TIMESTAMP DEFAULT UTC_TIMESTAMP();  #获取当前UTC时间

	SELECT InitialPrice,UnitShares  FROM Shares_Config LIMIT 0,1 INTO P_Sys_InitialPrice,P_Sys_UnitShares;

	#不存在股权价格记录则新增初始价格
	IF((SELECT COUNT(*) FROM Shares_Price) = 0) THEN
	END IF;

	SELECT MAX(Id) INTO P_PriceId FROM Shares_Price;
	SELECT Price INTO P_CurPrice FROM Shares_Price WHERE Id = P_PriceId ;


	SELECT MAX(NetUserId),ProductId, LastSalePrice_D FROM Net_Users WHERE UserId = P_UserId AND IsOut = 0 INTO P_NetUserId,P_ProductId,P_LastSalePrice;
	SET P_NetUserId = IFNULL(P_NetUserId,0);
	SET P_LastSalePrice = IFNULL(P_LastSalePrice,0);
	SET P_ProductId = IFNULL(P_ProductId,0);

	#SELECT P_PriceId, P_LastSalePrice,P_CurPrice;


	SELECT SUM(Shares - OutShares) INTO P_TotalShares FROM Shares WHERE UserId = P_UserId AND ShareType = 2  AND (Shares - OutShares) > 0 ;
	SET P_TotalShares = IFNULL(P_TotalShares,0);

	SELECT SUM(Shares * 0.2 ) INTO P_SurplusShares FROM Shares WHERE UserId = P_UserId AND ShareType = 2 AND SplitCount > 0  AND (Shares - OutShares) > 0;
	SET P_SurplusShares = IFNULL(P_SurplusShares,0);

	IF(P_SurplusShares > P_TotalShares) THEN
		SET P_SurplusShares = P_TotalShares;
	END IF;

	IF((P_CurPrice - P_LastSalePrice) < 0.01) THEN
		SET P_SurplusShares = 0;
	END IF;


	IF(P_CurPrice > 0.3) THEN #时价大于0.3不能卖
		SET P_SurplusShares = 0;
	END IF;

	SELECT  P_SurplusShares AS CanSellShares,P_TotalShares AS TotalShares;

END
;;
DELIMITER ;

