-- ----------------------------
-- Procedure structure for P_GuidanceSell
-- ----------------------------
DROP PROCEDURE IF EXISTS `P_GuidanceSell`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `P_GuidanceSell`(IN `P_BeginDate` datetime,IN `P_EndDate` datetime,IN `P_ProductId` int,IN `P_MaxShares` int)
BEGIN
	DECLARE P_UserId BIGINT;
	DECLARE P_SurplusShares BIGINT; #结余股数
	DECLARE P_UserName VARCHAR(100);
	DECLARE P_CurPrice decimal(10,3);     #当前价格
	DECLARE P_ThisDeductProfit decimal(10,3);   #本次指导销售扣除收益

	DECLARE P_Now TIMESTAMP DEFAULT UTC_TIMESTAMP();  #获取当前UTC时间

	SELECT Price INTO P_CurPrice FROM Shares_Price ORDER BY Id DESC LIMIT 0,1;
	
	SELECT MIN(UserId) INTO P_UserId FROM Net_Users WHERE IsOut = 0 AND ProductId = P_ProductId 
		AND cdate >= date_format(P_BeginDate,'%Y-%m-%d 00:00:01')	AND cdate <= date_format(P_EndDate,'%Y-%m-%d 23:59:59')	
		AND (SELECT SUM(Shares - OutShares) FROM Shares WHERE UserId = Net_Users.UserId AND (Shares - OutShares)> 0 ) > P_MaxShares;
	SET P_UserId = IFNULL(P_UserId,0);

	
	
	WHILE (P_UserId > 0 AND P_UserId IS NOT NULL) DO

		#SELECT P_UserId;
		SET P_ThisDeductProfit = 0;
		SET P_UserId = IFNULL(P_UserId,0);


		SELECT UserName INTO P_UserName FROM Users WHERE UserId = P_UserId;
		SELECT SUM(Shares - OutShares) INTO P_SurplusShares FROM Shares WHERE UserId = P_UserId AND (Shares - OutShares)> 0;

		SET P_ThisDeductProfit = (P_SurplusShares - P_MaxShares) * P_CurPrice;
		SET P_ThisDeductProfit = IFNULL(P_ThisDeductProfit,0);
		UPDATE Net_Users SET DeductProfit = DeductProfit + P_ThisDeductProfit WHERE UserId = P_UserId;

		UPDATE Shares SET OutShares = Shares,Remark = CONCAT(Remark,'|',P_Now,' 指导销售抹平',(Shares - OutShares))  WHERE UserId = P_UserId AND (Shares - OutShares)> 0;

			SELECT 0 AS BuyId, UserId,NetUserId,ShareType, 1 AS IsOriginalStake,Price,P_MaxShares AS Shares,SplitCount,P_Now AS LastOutDate,CONCAT('指导销售',P_MaxShares),P_Now AS cdate 
			FROM Shares WHERE UserId = P_UserId ORDER BY ShareId DESC LIMIT 0,1;

		SELECT MIN(UserId) INTO P_UserId FROM Net_Users WHERE UserId > P_UserId AND IsOut = 0 AND ProductId = P_ProductId 
			AND cdate >= date_format(P_BeginDate,'%Y-%m-%d 00:00:01')	AND cdate <= date_format(P_EndDate,'%Y-%m-%d 23:59:59')	
			AND (SELECT SUM(Shares - OutShares) FROM Shares WHERE UserId = Net_Users.UserId AND (Shares - OutShares)> 0 ) > P_MaxShares;
		SET P_UserId = IFNULL(P_UserId,0);
	END WHILE;
	

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for P_PayBonus
-- ----------------------------
DROP PROCEDURE IF EXISTS `P_PayBonus`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `P_PayBonus`(IN P_UserId int)
PL:BEGIN
	DECLARE P_Sys_DTFTBL decimal(10,3);    #动态复投比例
	DECLARE P_Sys_DTTXBL decimal(10,3);    #动态电子积分比例
	DECLARE P_Sys_DTLYJFBL decimal(10,3);  #动态旅游积分比例
	DECLARE P_ProductId INT;    #商品ID
	DECLARE P_Invested decimal(10,3);    #投资额
	DECLARE P_TJJBL decimal(10,3);   #推荐奖比例
	DECLARE P_DPJBL decimal(10,3);   #对碰奖比例
	DECLARE P_FDJ1BL decimal(10,3);   #1代辅导奖比例
	DECLARE P_FDJ2BL decimal(10,3);   #2代辅导奖比例
	DECLARE P_FDJ3BL decimal(10,3);   #3代辅导奖比例
	DECLARE P_FDJ4BL decimal(10,3);   #4代辅导奖比例
 	DECLARE P_FDJ5BL decimal(10,3);   #5代辅导奖比例
 	DECLARE P_FDJ6BL decimal(10,3);   #6代辅导奖比例

 	DECLARE P_JDJCS INT;   #见点奖层数

	DECLARE	P_IsOut INT;  #是否出局
	DECLARE	P_TJRS INT DEFAULT  0;  #推荐人数
 	DECLARE P_UserName varchar(512);   #会员编号
 	DECLARE P_ParentUserId BIGINT;   #上级用户
 	DECLARE P_RecommendUserId BIGINT;   #推荐用户
 	DECLARE P_LoopCount INT DEFAULT 0;   #循环次数
	DECLARE P_UserBonus decimal(10,3) DEFAULT 0;  #用户可得总积分
	DECLARE P_UserCashBonus decimal(10,3) DEFAULT 0;  #用户可提现积分
	DECLARE P_UserFTBonus decimal(10,3) DEFAULT 0;  #用户复投积分
	DECLARE P_UserLYBonus decimal(10,3) DEFAULT 0;  #用户旅游积分
	DECLARE P_ReProductId INT;  #推荐人购买的理财计划

	DECLARE P_Now TIMESTAMP DEFAULT UTC_TIMESTAMP();  #获取当前UTC时间
	
	#查询是否存在日统计
	IF((SELECT COUNT(*) FROM Shares_Statistics WHERE  to_days(cdate) = to_days(P_Now) ) = 0) THEN
	END IF;

	#查询用户资料记录是否存在
	IF((SELECT COUNT(*) FROM Users_Profile WHERE UserId = P_UserId ) = 0) THEN
	END IF;

	CALL P_UpdateTeamCount (P_UserId);



	SELECT UserName ,RecommendUserId,ParentUserId FROM Users WHERE UserId = P_UserId INTO P_UserName ,P_RecommendUserId ,P_ParentUserId;

	SELECT DTFTBL,DTTXBL,DTLYJFBL  FROM Shares_Config LIMIT 0,1  INTO P_Sys_DTFTBL,P_Sys_DTTXBL,P_Sys_DTLYJFBL;
	
	SELECT Price INTO P_Invested  FROM Net_Users WHERE UserId = P_UserId  ORDER BY NetUserId DESC LIMIT 0,1 ;

	UPDATE Shares_Statistics SET TotalProfit = TotalProfit + P_Invested WHERE to_days(cdate) = to_days(P_Now);  #更新每日新报业绩


	#计算推荐奖，领导奖
	WHILE (P_RecommendUserId > 0 AND P_RecommendUserId IS NOT NULL) DO
			SET P_ReProductId = 1;  
			SET P_LoopCount = P_LoopCount + 1;
			
			SELECT ProductId,IsOut FROM Net_Users WHERE UserId = P_RecommendUserId  ORDER BY NetUserId DESC LIMIT 0,1  INTO P_ReProductId,P_IsOut;
			SET P_IsOut = IFNULL(P_IsOut,1);

			SELECT TJJ,DPJ,FDJ1,FDJ2,FDJ3,FDJ4,FDJ5,FDJ6,JDJCS  FROM Products WHERE ProductId = P_ReProductId  
			INTO P_TJJBL,P_DPJBL,P_FDJ1BL,P_FDJ2BL,P_FDJ3BL,P_FDJ4BL,P_FDJ5BL,P_FDJ6BL,P_JDJCS;

			SELECT COUNT(*) INTO P_TJRS FROM Net_Users WHERE RecommendUserId = P_RecommendUserId AND ProductId >= P_ReProductId;
			SET P_TJRS = IFNULL(P_TJRS,0);

			SELECT P_RecommendUserId AS RecommendUserId,P_TJRS AS TJRS,P_ReProductId AS ReProductId;

			#第一代
			IF(P_LoopCount = 1) THEN
				#SELECT P_LoopCount;

				SET P_UserBonus = P_Invested * (P_TJJBL/100);
				#SELECT P_UserBonus;
				IF(P_UserBonus > 0) THEN
					SET P_UserCashBonus = P_UserBonus * (P_Sys_DTTXBL/100);
					SET P_UserFTBonus = P_UserBonus * (P_Sys_DTFTBL/100);
					SET P_UserLYBonus = P_UserBonus * (P_Sys_DTLYJFBL/100);

					VALUES (P_RecommendUserId,P_UserId,1,1,1,P_UserBonus,P_UserCashBonus,P_UserFTBonus,P_UserLYBonus,CONCAT('推荐会员:',P_UserName,'获得推荐奖'),P_Now);
					
					#更新每日统计
					UPDATE Shares_Statistics SET DTBonus = DTBonus + P_UserCashBonus,DTFT = DTFT + P_UserFTBonus,DTLY = DTLY + P_UserLYBonus WHERE to_days(cdate) = to_days(P_Now);

					#更新账户余额
					UPDATE Users_Asset 
					SET TotalBonus = TotalBonus + P_UserCashBonus ,BonusSurplus = BonusSurplus + P_UserCashBonus , DTFTJJ = DTFTJJ + P_UserFTBonus , DTFTJJYE = DTFTJJYE + P_UserFTBonus, LYJF = LYJF + P_UserLYBonus , LYJFYE = LYJFYE + P_UserLYBonus
					WHERE UserId = P_RecommendUserId;
				END IF;




			END IF;




			#第二代
			IF(P_LoopCount = 2 AND P_TJRS >= 2 AND P_FDJ1BL > 0) THEN
				#SELECT P_LoopCount;

				SET P_UserBonus = P_Invested * (P_FDJ1BL/100);
				#SELECT P_UserBonus;
				IF(P_UserBonus > 0) THEN
					SET P_UserCashBonus = P_UserBonus * (P_Sys_DTTXBL/100);
					SET P_UserFTBonus = P_UserBonus * (P_Sys_DTFTBL/100);
					SET P_UserLYBonus = P_UserBonus * (P_Sys_DTLYJFBL/100);
					

					VALUES (P_RecommendUserId,P_UserId,1,3,1,P_UserBonus,P_UserCashBonus,P_UserFTBonus,P_UserLYBonus,CONCAT('激活会员:',P_UserName,'获得辅导奖'),P_Now);
					
					#更新每日统计
					UPDATE Shares_Statistics SET DTBonus = DTBonus + P_UserCashBonus,DTFT = DTFT + P_UserFTBonus,DTLY = DTLY + P_UserLYBonus WHERE to_days(cdate) = to_days(P_Now);

					#更新账户余额
					UPDATE Users_Asset 
					SET TotalBonus = TotalBonus + P_UserCashBonus ,BonusSurplus = BonusSurplus + P_UserCashBonus , DTFTJJ = DTFTJJ + P_UserFTBonus , DTFTJJYE = DTFTJJYE + P_UserFTBonus, LYJF = LYJF + P_UserLYBonus , LYJFYE = LYJFYE + P_UserLYBonus
					WHERE UserId = P_RecommendUserId;
				END IF;

			END IF;


			#第三代
			IF(P_LoopCount = 3 AND P_TJRS >= 2 AND P_FDJ2BL > 0) THEN
				#SELECT P_LoopCount;

				SET P_UserBonus = P_Invested * (P_FDJ2BL/100);
				#SELECT P_UserBonus;
				IF(P_UserBonus > 0) THEN
					SET P_UserCashBonus = P_UserBonus * (P_Sys_DTTXBL/100);
					SET P_UserFTBonus = P_UserBonus * (P_Sys_DTFTBL/100);
					SET P_UserLYBonus = P_UserBonus * (P_Sys_DTLYJFBL/100);

					VALUES (P_RecommendUserId,P_UserId,1,3,1,P_UserBonus,P_UserCashBonus,P_UserFTBonus,P_UserLYBonus,CONCAT('激活会员:',P_UserName,'获得辅导奖'),P_Now);
					
					#更新每日统计
					UPDATE Shares_Statistics SET DTBonus = DTBonus + P_UserCashBonus,DTFT = DTFT + P_UserFTBonus,DTLY = DTLY + P_UserLYBonus WHERE to_days(cdate) = to_days(P_Now);

					#更新账户余额
					UPDATE Users_Asset 
					SET TotalBonus = TotalBonus + P_UserCashBonus ,BonusSurplus = BonusSurplus + P_UserCashBonus , DTFTJJ = DTFTJJ + P_UserFTBonus , DTFTJJYE = DTFTJJYE + P_UserFTBonus, LYJF = LYJF + P_UserLYBonus , LYJFYE = LYJFYE + P_UserLYBonus
					WHERE UserId = P_RecommendUserId;

				END IF;

			END IF;
			
			#第三代
			IF(P_LoopCount = 4 AND P_TJRS >= 2 AND P_FDJ3BL > 0) THEN
				#SELECT P_LoopCount;

				SET P_UserBonus = P_Invested * (P_FDJ3BL/100);
				#SELECT P_UserBonus;
				IF(P_UserBonus > 0) THEN
					SET P_UserCashBonus = P_UserBonus * (P_Sys_DTTXBL/100);
					SET P_UserFTBonus = P_UserBonus * (P_Sys_DTFTBL/100);
					SET P_UserLYBonus = P_UserBonus * (P_Sys_DTLYJFBL/100);

					VALUES (P_RecommendUserId,P_UserId,1,3,1,P_UserBonus,P_UserCashBonus,P_UserFTBonus,P_UserLYBonus,CONCAT('激活会员:',P_UserName,'获得辅导奖'),P_Now);
					
					#更新每日统计
					UPDATE Shares_Statistics SET DTBonus = DTBonus + P_UserCashBonus,DTFT = DTFT + P_UserFTBonus,DTLY = DTLY + P_UserLYBonus WHERE to_days(cdate) = to_days(P_Now);

					#更新账户余额
					UPDATE Users_Asset 
					SET TotalBonus = TotalBonus + P_UserCashBonus ,BonusSurplus = BonusSurplus + P_UserCashBonus , DTFTJJ = DTFTJJ + P_UserFTBonus , DTFTJJYE = DTFTJJYE + P_UserFTBonus, LYJF = LYJF + P_UserLYBonus , LYJFYE = LYJFYE + P_UserLYBonus
					WHERE UserId = P_RecommendUserId;

				END IF;
			END IF;
			
			#第四代
