-- ----------------------------
-- Procedure structure for P_Refund_Buy
-- ----------------------------
DROP PROCEDURE IF EXISTS `P_Refund_Buy`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `P_Refund_Buy`(IN P_BuyId bigint)
BEGIN
	
	DECLARE P_BuySurplus decimal(10,3);    #结余金额
	DECLARE P_FundType INT; #资金类型
	DECLARE P_UserId BIGINT;
	DECLARE P_Now TIMESTAMP DEFAULT UTC_TIMESTAMP();  #获取当前UTC时间

	SELECT UserId,(Price-SuccesPrice), FundType  FROM Shares_Buy WHERE BuyId = P_BuyId INTO P_UserId,P_BuySurplus,P_FundType;
	SET P_BuySurplus = IFNULL(P_BuySurplus,0);

	SELECT P_BuySurplus as BuySurplus;

	IF (P_BuySurplus > 0) THEN
			VALUES (P_UserId,P_UserId,2,5,1,P_BuySurplus,P_BuySurplus,CONCAT('买入结余退回'),P_Now);

			#INSERT INTO Users_Cash_Bonus(UserId,TradeType,BonusType,Amount,FromUserId,InOrOut,Remark,cdate) 
			#VALUES (P_UserId,1,5,P_BuySurplus,P_UserId,1,CONCAT('买入结余退回'),NOW());
			UPDATE Users_Asset SET BonusSurplus = BonusSurplus + P_BuySurplus WHERE UserId = P_UserId;

	END IF;

	UPDATE Shares_Buy SET SuccesPrice = Price ,`Status` = 0 WHERE BuyId = P_BuyId;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for P_Shares_Auto_Buy
-- ----------------------------
DROP PROCEDURE IF EXISTS `P_Shares_Auto_Buy`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `P_Shares_Auto_Buy`(IN P_Count bigint)
PL:BEGIN
	DECLARE P_BuyId BIGINT;
	DECLARE P_Now TIMESTAMP DEFAULT UTC_TIMESTAMP();  #获取当前UTC时间

	SET P_Count  = IFNULL(P_Count ,0);
	IF(P_Count  = 0) THEN
		LEAVE PL ;  #跳出执行存储过程
	END IF;


	#查询是否存在日统计
	IF((SELECT COUNT(*) FROM Shares_Statistics WHERE  to_days(cdate) = to_days(P_Now) ) = 0) THEN
	END IF;

	
	SELECT MIN(BuyId) INTO P_BuyId FROM Shares_Buy WHERE (Price-SuccesPrice) > 0 AND `Status` = 1;
	SET P_BuyId = IFNULL(P_BuyId,0);
	WHILE (P_BuyId > 0 AND P_Count > 0) DO
		#SELECT P_BuyId;
		CALL P_Shares_Buy(P_BuyId);

		SET P_Count = P_Count - 1;

		SELECT MIN(BuyId) INTO P_BuyId FROM Shares_Buy WHERE BuyId > P_BuyId AND (Price-SuccesPrice) > 0 AND `Status` = 1;
		SET P_BuyId = IFNULL(P_BuyId,0);
	END WHILE;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for P_Shares_Buy
-- ----------------------------
DROP PROCEDURE IF EXISTS `P_Shares_Buy`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `P_Shares_Buy`(IN P_BuyId bigint)
PL:BEGIN
	
		DECLARE P_Sys_InitialPrice decimal(10,3);  #初始价格
		DECLARE P_Sys_SplitPrice decimal(10,3);    #拆分价格
		DECLARE P_Sys_UnitPrice decimal(10,3);     #单位价格涨幅0.001
		DECLARE P_Sys_UnitShares BIGINT;    #单位价格股数
		DECLARE P_Sys_JTSXFBL decimal(10,3);    #交易手续费
		DECLARE P_Sys_JTTXBL decimal(10,3);    #静态提现比例
		DECLARE P_Sys_JTFTBL decimal(10,3);    #单位价格股数
		DECLARE P_Sys_JTSCJFBL decimal(10,3);    #单位价格股数

		DECLARE P_PriceId INT;     #价格ID
		DECLARE P_CurPrice decimal(10,3);     #当前价格
		DECLARE P_CurPriceDate DATETIME ;     #当前价格
		DECLARE P_CurPriceSaledShares INT;         #当前价格已售股数股数
		DECLARE P_CurPriceMaxShares INT;         #当前价格最大可售股数

		DECLARE P_UserId BIGINT;  #买入用户Id
		DECLARE P_NetUserId BIGINT;  #买入用户网体Id
		DECLARE P_FundType INT;  #买入资金类型
		DECLARE P_BuyAmount decimal(10,3);     #挂买金额
		DECLARE P_SuccesBuyAmount decimal(10,3);     #已买金额
		DECLARE P_CanBuyShares INT;     #可买股数
		DECLARE P_ShareType TINYINT DEFAULT 2;  #股权类型 1多次拆分2单次拆分

		DECLARE P_UserBuyShares INT DEFAULT 0;     #用户成功购买股数

		DECLARE P_SellId BIGINT;   #挂卖交易ID
		DECLARE P_SellUserId BIGINT; #挂卖用户ID
		DECLARE P_SellNetUserId BIGINT;# 挂卖用户网体ID
		DECLARE P_SellShareType TINYINT ; #挂卖股票类型
		DECLARE P_SellProductId BIGINT;#挂卖用户产品ID
		DECLARE P_ProductCJBS INT; #挂卖用户购买产品出局倍数
		DECLARE P_ProductMaxProfit decimal(10,3); #产品总收益
		DECLARE P_SellUserProfit decimal(10,3); #挂卖用户总收益
		DECLARE P_CanSellShares BIGINT;    #挂卖交易记录可卖股数
		DECLARE P_SellIsOut INT DEFAULT 0; #挂卖是否已出局
		DECLARE P_ThisTradeShares BIGINT;   #本次可交易股数
		DECLARE P_ThisTradeSharesProfit decimal(10,3);   #本次可交易股数收益
		DECLARE P_ThisTradeJYF decimal(10,3);   #本次可交易费
		DECLARE P_ThisTradeBonus decimal(10,3);   #本次可交易收益
		DECLARE P_ThisTradeJTFTBonus decimal(10,3);   #本次可交易静态复投
		DECLARE P_ThisTradeJTSCBonus decimal(10,3);   #本次可交易静态商城


		DECLARE P_SplitUserCount BIGINT DEFAULT 0;  #拆分用户数
		DECLARE P_LargessShares BIGINT DEFAULT 0;  #赠送股数

	DECLARE P_Now TIMESTAMP DEFAULT UTC_TIMESTAMP();  #获取当前UTC时间

		SELECT InitialPrice,SplitPrice,UnitPrice,UnitShares,JTSXFBL,JTTXBL,JTFTBL,JTSCJFBL  FROM Shares_Config LIMIT 0,1  
		INTO P_Sys_InitialPrice,P_Sys_SplitPrice,P_Sys_UnitPrice,P_Sys_UnitShares,P_Sys_JTSXFBL,P_Sys_JTTXBL,P_Sys_JTFTBL,P_Sys_JTSCJFBL;

		
		#不存在股权价格记录则新增初始价格
		IF((SELECT COUNT(*) FROM Shares_Price) = 0) THEN
		END IF;

		#验证是否可以拆分
		#IF((SELECT Price FROM Shares_Price ORDER BY Id DESC  LIMIT 0,1 ) >= P_Sys_SplitPrice) THEN
		#	CALL P_SplitShares;
		#LEAVE PL ;  #跳出执行存储过程
		#END IF;


		SELECT Id,Price,Shares,SuccesShares,cdate FROM Shares_Price ORDER BY Id DESC LIMIT 0,1 INTO P_PriceId,P_CurPrice,P_CurPriceMaxShares,P_CurPriceSaledShares,P_CurPriceDate;

		SELECT UserId,NetUserId,FundType,Price,SuccesPrice FROM Shares_Buy WHERE BuyId = P_BuyId INTO P_UserId,P_NetUserId,P_FundType, P_BuyAmount,P_SuccesBuyAmount;

		SET P_ShareType = 1;

		IF (P_BuyAmount <= P_SuccesBuyAmount) THEN
			UPDATE Shares_Buy SET Status = 0 WHERE BuyId = P_BuyId;
			LEAVE PL ;  #跳出执行存储过程
		END IF;

		IF ((P_BuyAmount - P_SuccesBuyAmount) < P_CurPrice) THEN
			CALL P_Refund_Buy(P_BuyId);
			LEAVE PL ;  #跳出执行存储过程
		END IF;

		SET P_CanBuyShares =  FLOOR((P_BuyAmount - P_SuccesBuyAmount) / P_CurPrice);  #用户结余金额 可买股数

		IF(P_CanBuyShares > 0) THEN
			
			SET P_ThisTradeShares = P_CanBuyShares;
			SET P_CanBuyShares = 0;
			
			UPDATE Shares_Price SET SuccesShares = SuccesShares + P_ThisTradeShares  WHERE Id = P_PriceId;
			UPDATE Shares_Buy SET SuccesShares = SuccesShares + P_ThisTradeShares , SuccesPrice = SuccesPrice + (P_ThisTradeShares * P_CurPrice) WHERE BuyId = P_BuyId;

			#更新每日统计
			UPDATE Shares_Statistics 
			SET BuyShares = BuyShares + P_ThisTradeShares,SysSellShares = SysSellShares + P_ThisTradeShares
			, BuyAmount = BuyAmount + (P_ThisTradeShares * P_CurPrice),SysSellAmount = SysSellAmount + (P_ThisTradeShares * P_CurPrice)
			WHERE to_days(cdate) = to_days(P_Now);

			IF (P_CanBuyShares = 0) THEN
				CALL P_Refund_Buy(P_BuyId);
				LEAVE PL ;  #跳出执行存储过程
			END IF;

		END IF;



END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for P_Shares_Sell
-- ----------------------------
DROP PROCEDURE IF EXISTS `P_Shares_Sell`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `P_Shares_Sell`(IN P_SellId bigint)
PL:BEGIN
	
		DECLARE P_Sys_InitialPrice decimal(10,3);  #初始价格
		DECLARE P_Sys_SplitPrice decimal(10,3);    #拆分价格
		DECLARE P_Sys_UnitPrice decimal(10,3);     #单位价格涨幅0.001
		DECLARE P_Sys_UnitShares BIGINT;    #单位价格股数
		DECLARE P_Sys_JTSXFBL decimal(10,3);    #交易手续费
		DECLARE P_Sys_JTTXBL decimal(10,3);    #静态提现比例
		DECLARE P_Sys_JTFTBL decimal(10,3);    #单位价格股数
		DECLARE P_Sys_JTSCJFBL decimal(10,3);    #单位价格股数

		DECLARE P_PriceId INT;     #价格ID
		DECLARE P_CurPrice decimal(10,3);     #当前价格
		DECLARE P_CurPriceDate DATETIME ;     #当前价格
		DECLARE P_CurPriceSaledShares INT;         #当前价格已售股数股数
		DECLARE P_CurPriceMaxShares INT;         #当前价格最大可售股数

		DECLARE P_UserId BIGINT;  #买入用户Id
		DECLARE P_NetUserId BIGINT;  #买入用户网体Id
		DECLARE P_FundType INT;  #买入资金类型
		DECLARE P_BuyAmount decimal(10,3);     #挂买金额
		DECLARE P_SuccesBuyAmount decimal(10,3);     #已买金额
		DECLARE P_CanBuyShares INT;     #可买股数
		DECLARE P_ShareType TINYINT DEFAULT 2;  #股权类型 1多次拆分2单次拆分

		DECLARE P_UserBuyShares INT DEFAULT 0;     #用户成功购买股数

		DECLARE P_SellStatus INT;#卖出记录状态
		DECLARE P_SellUserId BIGINT; #挂卖用户ID
		DECLARE P_SellNetUserId BIGINT;# 挂卖用户网体ID
		DECLARE P_SellShareType TINYINT ; #挂卖股票类型
		DECLARE P_SellProductId BIGINT;#挂卖用户产品ID
		DECLARE P_ProductCJBS INT; #挂卖用户购买产品出局倍数
		DECLARE P_ProductMaxProfit decimal(10,3); #产品总收益
		DECLARE P_SellUserProfit decimal(10,3); #挂卖用户总收益
		DECLARE P_CanSellShares BIGINT;    #挂卖交易记录可卖股数
		DECLARE P_SellIsOut INT DEFAULT 0; #挂卖是否已出局
		DECLARE P_ThisTradeShares BIGINT;   #本次可交易股数
		DECLARE P_ThisTradeSharesProfit decimal(10,3);   #本次可交易股数收益
		DECLARE P_ThisTradeJYF decimal(10,3);   #本次可交易费
		DECLARE P_ThisTradeBonus decimal(10,3);   #本次可交易收益
		DECLARE P_ThisTradeJTFTBonus decimal(10,3);   #本次可交易静态复投
		DECLARE P_ThisTradeJTSCBonus decimal(10,3);   #本次可交易静态商城


		DECLARE P_SplitUserCount BIGINT DEFAULT 0;  #拆分用户数
		DECLARE P_LargessShares BIGINT DEFAULT 0;  #赠送股数

	DECLARE P_Now TIMESTAMP DEFAULT UTC_TIMESTAMP();  #获取当前UTC时间

		SELECT InitialPrice,SplitPrice,UnitPrice,UnitShares,JTSXFBL,JTTXBL,JTFTBL,JTSCJFBL  FROM Shares_Config LIMIT 0,1  
		INTO P_Sys_InitialPrice,P_Sys_SplitPrice,P_Sys_UnitPrice,P_Sys_UnitShares,P_Sys_JTSXFBL,P_Sys_JTTXBL,P_Sys_JTFTBL,P_Sys_JTSCJFBL;


		#SELECT P_Sys_SplitPrice as SplitPrice,P_SellId as SellId;

		SET P_SellId = IFNULL(P_SellId,0);
		IF(P_SellId = 0) THEN
			LEAVE PL ;  #跳出执行存储过程
		END IF;

		#验证是否可以拆分
		#IF((SELECT Price FROM Shares_Price ORDER BY Id DESC  LIMIT 0,1 ) >= P_Sys_SplitPrice) THEN
		#	CALL P_SplitShares;
		#	LEAVE PL ;  #跳出执行存储过程
		#END IF;


		SELECT Id,Price,Shares,SuccesShares,cdate FROM Shares_Price ORDER BY Id DESC LIMIT 0,1 INTO P_PriceId,P_CurPrice,P_CurPriceMaxShares,P_CurPriceSaledShares,P_CurPriceDate;
		SET P_ShareType = 1;


		SET P_SellIsOut = 0;
		SELECT UserId,NetUserId,(Shares - SuccesShares),ShareType,Status FROM Shares_Sell WHERE SellId = P_SellId INTO P_SellUserId,P_SellNetUserId,P_CanSellShares,P_SellShareType,P_SellStatus ;
		SELECT ProductId,TotalProfit FROM Net_Users WHERE NetUserId = P_SellNetUserId INTO P_SellProductId,P_SellUserProfit;
		SELECT  (Invested * CJBS) INTO P_ProductMaxProfit FROM Products WHERE ProductId = P_SellProductId;


		#验证状态是否为0
		SET P_SellStatus = IFNULL(P_SellStatus,0);
		IF( P_SellStatus = 0) THEN
			LEAVE PL ;  #跳出执行存储过程
		END IF;
		
		#SELECT P_SellUserId as SellUserId, P_SellUserProfit as SellUserProfit, P_ProductMaxProfit AS ProductMaxProfit, 1 as  收益查询1;
	
		IF (P_SellUserProfit >=  P_ProductMaxProfit) THEN  #如果是卖的静态则验证收益是否封顶
			SET P_CanSellShares = 0;
			SET P_SellIsOut = 1;
		ELSE
			IF (FLOOR((P_ProductMaxProfit - P_SellUserProfit) / P_CurPrice ) <= P_CanSellShares) THEN
				SET P_CanSellShares = FLOOR((P_ProductMaxProfit - P_SellUserProfit) / P_CurPrice );
				SET P_SellIsOut = 1;
			END IF;
		END IF;

		#SELECT P_SellUserId as SellUserId, P_SellUserProfit as SellUserProfit, P_ProductMaxProfit AS ProductMaxProfit,P_CanSellShares as CanSellShares, 1 as  收益查询2;
		
		IF (P_CanSellShares > 0) THEN
			SET P_ThisTradeShares = P_CanSellShares;

			SET P_ThisTradeSharesProfit = P_ThisTradeShares * P_CurPrice;

			#SELECT P_ThisTradeSharesProfit as ThisTradeSharesProfit;

			UPDATE Shares_Price SET UserShares = UserShares + P_ThisTradeShares WHERE Id = P_PriceId;
			
			

			SET P_ThisTradeJYF = P_ThisTradeSharesProfit * (P_Sys_JTSXFBL / 100); #交易手续费
			SET P_ThisTradeBonus = (P_ThisTradeSharesProfit - P_ThisTradeJYF) * (P_Sys_JTTXBL / 100); #奖金
			SET P_ThisTradeJTFTBonus = (P_ThisTradeSharesProfit - P_ThisTradeJYF)  * (P_Sys_JTFTBL / 100); #复投
			SET P_ThisTradeJTSCBonus = (P_ThisTradeSharesProfit - P_ThisTradeJYF)  * (P_Sys_JTSCJFBL / 100); #商城

			IF (P_ThisTradeSharesProfit > 0) THEN
				#进入静态账户
				UPDATE Net_Users SET TotalProfit = TotalProfit + P_ThisTradeSharesProfit WHERE NetUserId = P_SellNetUserId ;

				UPDATE Shares_Sell SET SuccesShares = Shares,`Status` = 0 WHERE SellId = P_SellId;
		
				VALUES (P_SellUserId,P_SellUserId,2,5,1,P_ThisTradeSharesProfit,P_ThisTradeBonus,P_ThisTradeJTFTBonus,P_ThisTradeJTSCBonus,P_ThisTradeJYF,CONCAT('权证卖出收益'),P_Now);

				#更新每日统计
				UPDATE Shares_Statistics 
				SET BuyShares = BuyShares + P_ThisTradeShares,UserSellShares = UserSellShares + P_ThisTradeShares
				, BuyAmount = BuyAmount + P_ThisTradeSharesProfit,UserSellAmount = UserSellAmount + P_ThisTradeSharesProfit
				, JTBonus = JTBonus + P_ThisTradeBonus,JTFT = JTFT + P_ThisTradeJTFTBonus,JTSC = JTSC + P_ThisTradeJTSCBonus
				WHERE to_days(cdate) = to_days(P_Now);   #本处为静态卖出收益，报单积分不计入日统计，避免动态拨比统计不准确

				#更新账户余额
				UPDATE Users_Asset 
				SET TotalBonus = TotalBonus + P_ThisTradeBonus ,BonusSurplus = BonusSurplus + P_ThisTradeBonus
					, DTFTJJ = DTFTJJ + P_ThisTradeJTFTBonus, DTFTJJYE = DTFTJJYE + P_ThisTradeJTFTBonus
					, SCJF = SCJF + P_ThisTradeJTSCBonus , SCJFYE = SCJFYE + P_ThisTradeJTSCBonus
				WHERE UserId = P_SellUserId;
			END IF;
		END IF;

		IF (P_SellIsOut = 1) THEN  #已出局 平掉用户所有股权
			UPDATE Net_Users SET IsOut = 1 WHERE NetUserId = P_SellNetUserId;
			UPDATE Shares SET OutShares = Shares WHERE NetUserId = P_SellNetUserId ;
			UPDATE Shares_Trade SET SellShares = Shares WHERE NetUserId = P_SellNetUserId;
			UPDATE Shares_Sell SET SuccesShares = Shares,`Status` = 0 WHERE NetUserId = P_SellNetUserId;
		END IF;



END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for P_Shares_Subtract
-- ----------------------------
DROP PROCEDURE IF EXISTS `P_Shares_Subtract`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `P_Shares_Subtract`(IN P_UserId bigint, IN P_TradeType VARCHAR(100))
    COMMENT '扣除用户股数'
PL:BEGIN
	
	DECLARE P_KGBL decimal(10,2) DEFAULT 0.1;  #扣股比例
	DECLARE P_SurplusShares BIGINT ; #结余股数
	DECLARE P_SurplusThisShares BIGINT ; #本条结余股数
	DECLARE P_SubtractShares BIGINT; #本次扣除股数
	DECLARE P_UserName VARCHAR(100);
	DECLARE P_WGCS INT DEFAULT 0;  #违规次数
 	DECLARE P_Now TIMESTAMP DEFAULT UTC_TIMESTAMP();  #获取当前UTC时间
	DECLARE P_MinId BIGINT;


	SELECT UserName,ViolationNum FROM Users WHERE UserId = P_UserId  INTO P_UserName,P_WGCS;
	SET P_WGCS = IFNULL(P_WGCS,0);

	UPDATE Users SET ViolationNum = ViolationNum + 1  WHERE UserId = P_UserId; #更新违规次数

	IF (P_WGCS = 1) THEN
		SET P_KGBL= 0.2;
	END IF;


	IF (P_WGCS >= 2) THEN
		UPDATE Users SET `Status` = -1  WHERE UserId = P_UserId;
		LEAVE PL ;  #跳出执行存储过程
	END IF;
	
	SELECT SUM((Shares - OutShares)) INTO P_SurplusShares FROM Shares WHERE UserId = P_UserId  AND (Shares - OutShares) > 0;
	SET P_SurplusShares = IFNULL(P_SurplusShares,0);

	SET P_SubtractShares = FLOOR(P_SurplusShares * P_KGBL);

	IF (P_SubtractShares > 0 ) THEN
	END IF;
	
	SELECT MIN(ShareId) INTO P_MinId FROM Shares WHERE UserId = P_UserId  AND (Shares - OutShares) > 0;
	SET P_MinId = IFNULL(P_MinId,0);

	WHILE (P_MinId > 0 AND P_SubtractShares > 0) DO
		SELECT (Shares - OutShares) INTO P_SurplusThisShares FROM Shares WHERE ShareId = P_MinId;
		SET P_SurplusThisShares = IFNULL(P_SurplusThisShares,0);


		IF(P_SubtractShares > P_SurplusThisShares) THEN
			SET P_SubtractShares = P_SubtractShares - P_SurplusThisShares;
			UPDATE Shares SET OutShares = Shares WHERE ShareId = P_MinId;
		ELSE
			UPDATE Shares SET OutShares = OutShares + P_SubtractShares WHERE ShareId = P_MinId;
			SET P_SubtractShares = 0;
		END IF;

		SELECT MIN(ShareId) INTO P_MinId  FROM Shares WHERE UserId = P_UserId AND ShareId > P_MinId AND (Shares - OutShares) > 0;
		SET P_MinId = IFNULL(P_MinId,0);
	END WHILE;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for P_SplitShares
-- ----------------------------
DROP PROCEDURE IF EXISTS `P_SplitShares`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `P_SplitShares`()
PL:BEGIN
		
		DECLARE P_Sys_InitialPrice decimal(10,3);  #初始价格
		DECLARE P_Sys_SplitPrice decimal(10,3);    #拆分价格
		DECLARE P_Sys_UnitShares BIGINT;    #权证书

		DECLARE P_CurPrice  decimal(10,3);  #当前价格
		


		DECLARE P_UserId BIGINT;
		DECLARE P_NetUserId BIGINT;
		DECLARE P_ProductId INT;
		DECLARE P_MaxShares  decimal(10,3);  #用户最大可持有股数
		DECLARE P_UserCurTotalShares INT; #用户当前总持有股数
		DECLARE P_UserFairishShares INT DEFAULT 0;  #用户还可以获得股数
		DECLARE P_ThisFairishShares INT DEFAULT 0;  #用户拆分可得股数
		DECLARE P_UserThisTotalShares INT DEFAULT 0;  #本次价格差收益


		DECLARE P_SplitCount INT DEFAULT 0;  #拆分次数
		DECLARE P_SurplusShares INT;  #结余股数

		DECLARE P_SplitUsersCount INT DEFAULT 0; #拆分用户数
		DECLARE P_Split_S_LargessShares INT DEFAULT 0; #拆分赠送总S股数
		DECLARE P_Split_D_LargessShares INT DEFAULT 0; #拆分赠送总D股数

		DECLARE P_Now TIMESTAMP DEFAULT UTC_TIMESTAMP();  #获取当前UTC时间

		IF(P_Now = CURRENT_TIMESTAMP()) THEN
			SET P_Now = CURRENT_TIMESTAMP();
		END IF;


		SELECT InitialPrice,SplitPrice,UnitShares  FROM Shares_Config LIMIT 0,1 INTO P_Sys_InitialPrice,P_Sys_SplitPrice,P_Sys_UnitShares;

		SELECT Price FROM Shares_Price ORDER BY Id DESC LIMIT 0,1 INTO P_CurPrice;


		IF(P_Sys_InitialPrice >= P_Sys_SplitPrice) THEN
			LEAVE PL;  #跳出执行存储过程
		END IF;

		SELECT MIN(NetUserId) INTO P_NetUserId FROM Net_Users WHERE IsOut = 0 AND (SELECT  COUNT(*) FROM Shares WHERE (Shares-OutShares) > 0 AND NetUserId = Net_Users.NetUserId) > 0;
		SET P_NetUserId = IFNULL(P_NetUserId,0);

		#SELECT P_CurPrice,P_Sys_SplitPrice,P_NetUserId;

		WHILE (P_NetUserId > 0) DO
			SELECT UserId,ProductId FROM Net_Users WHERE NetUserId = P_NetUserId INTO P_UserId,P_ProductId ;

			SELECT KCGS INTO P_MaxShares FROM Products WHERE ProductId = P_ProductId;  #最大可持有股数 （包含拆分后）

			SELECT  SUM(Shares-OutShares) INTO P_UserCurTotalShares FROM Shares WHERE (Shares-OutShares) > 0 AND NetUserId = P_NetUserId; #当前总持有股数
			SET P_UserCurTotalShares = IFNULL(P_UserCurTotalShares,0);

			SET P_UserFairishShares = 0;

			#IF (P_UserId = 344) THEN
			#	SELECT P_UserCurTotalShares AS UserCurTotalShares,P_MaxShares AS MaxShares ,P_UserFairishShares AS UserFairishShares ;
			#END IF;
			
			IF(P_UserCurTotalShares >= P_MaxShares) THEN   #现持有股数 超出最大持股数 抹平
					UPDATE Shares SET OutShares = Shares WHERE ShareType = 1 AND NetUserId = P_NetUserId;

					SELECT UserId,NetUserId,ShareType, 1 AS IsOriginalStake,Price,P_MaxShares AS Shares,SplitCount,P_Now AS LastOutDate,P_Now AS cdate 
					FROM Shares WHERE ShareType = 1 AND NetUserId = P_NetUserId ORDER BY ShareId DESC LIMIT 0,1;
			ELSE
					SET P_UserFairishShares =  P_MaxShares - P_UserCurTotalShares;
			END IF;

			#IF (P_UserId = 344) THEN 
			#	SELECT P_UserFairishShares AS UserFairishShares1;
			#END IF;

			SET P_UserThisTotalShares = P_UserCurTotalShares * (P_CurPrice - P_Sys_InitialPrice) / P_Sys_InitialPrice;
			SET P_UserThisTotalShares = IFNULL(P_UserThisTotalShares,0);

			IF(P_UserFairishShares >= P_UserThisTotalShares) THEN
					SET P_UserFairishShares = P_UserThisTotalShares;
			END IF;

			IF (P_UserFairishShares > 0) THEN  #如果可获得股数大于0 则算一个用户
				SET P_SplitUsersCount = P_SplitUsersCount + 1;
			END IF;

			IF(P_UserThisTotalShares >= P_UserFairishShares) THEN   #拆分差大于可得收益时使用可得收益
				SET P_ThisFairishShares = P_UserFairishShares;  
			ELSE
				SET P_ThisFairishShares = P_UserFairishShares * (P_CurPrice - P_Sys_InitialPrice) / P_Sys_InitialPrice;  #本次拆分可得股数
			END IF;

			#IF (P_UserId = 344) THEN
			#	SELECT P_UserFairishShares AS UserFairishShares2,P_ThisFairishShares AS ThisFairishShares,P_UserThisTotalShares AS UserThisTotalShares ;
			#END IF;

			IF (P_ThisFairishShares > 0) THEN  #本次拆分可得股数
						SET P_Split_S_LargessShares = P_Split_S_LargessShares + P_ThisFairishShares;

						SELECT UserId,NetUserId,ShareType, 0 AS IsOriginalStake,Price,P_ThisFairishShares AS Shares,SplitCount,CONCAT((SplitCount + 1), '次拆分时配送权证') AS Remark,P_Now AS LastOutDate,P_Now AS cdate 
						FROM Shares WHERE (Shares-OutShares) > 0 AND NetUserId = P_NetUserId ORDER BY ShareId DESC LIMIT 0,1;
			END IF;			
			
			UPDATE Shares SET SplitCount= SplitCount + 1 ,LastOutDate = P_Now WHERE (Shares-OutShares) > 0 AND NetUserId = P_NetUserId; #更新用户拆分次数
			
			SELECT MIN(NetUserId) INTO P_NetUserId FROM Net_Users WHERE NetUserId > P_NetUserId AND IsOut = 0 AND (SELECT  COUNT(*) FROM Shares WHERE (Shares-OutShares) > 0 AND NetUserId = Net_Users.NetUserId) > 0;
			SET P_NetUserId = IFNULL(P_NetUserId,0);
 
		END WHILE;




			VALUES (P_CurPrice,P_Sys_InitialPrice,P_SplitUsersCount,P_Split_S_LargessShares,P_Split_D_LargessShares,P_Now);

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for P_UpdateTeamCount
-- ----------------------------
DROP PROCEDURE IF EXISTS `P_UpdateTeamCount`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `P_UpdateTeamCount`(IN P_UserId bigint)
BEGIN

	DECLARE P_Sys_DTFTBL decimal(10,3);    #动态复投比例
	DECLARE P_Sys_DTTXBL decimal(10,3);    #动态电子积分比例
	DECLARE P_Sys_DTLYJFBL decimal(10,3);  #动态旅游积分比例
	DECLARE P_Sys_JDJBL decimal(10,3);  #见点奖比例
	DECLARE P_Sys_DPJZFDBS decimal(10,3);  #对碰奖周封顶倍数
	
	DECLARE P_UserName varchar(20);   #会员编号
	DECLARE P_ParentUserId BIGINT;
	DECLARE P_Invested decimal(10,3);    #投资额
	DECLARE P_PlaceArea INT;

	DECLARE P_LeftTurnoverSurplus decimal(20,3);  #左区结余
	DECLARE P_RightTurnoverSurplus decimal(20,3);  #右区结余

	DECLARE P_UserBonus decimal(10,3) DEFAULT 0;  #用户可得总积分
	DECLARE P_UserCashBonus decimal(10,3) DEFAULT 0;  #用户可提现积分
	DECLARE P_UserFTBonus decimal(10,3) DEFAULT 0;  #用户复投积分
	DECLARE P_UserLYBonus decimal(10,3) DEFAULT 0;  #用户旅游积分
	
	DECLARE	P_ReIsOut INT;  #是否出局
	DECLARE P_ReProductId INT;  #推荐人购买的理财计划
	DECLARE P_ReInvested decimal(10,3);    #上级投资额
	DECLARE P_ReTodayProfit decimal(10,3);    #上级今日收益
	DECLARE P_ReWeekProfit decimal(10,3);    #上级本周收益
	DECLARE P_ReWeekMaxProfit decimal(10,3);    #上级周最大收益


	DECLARE P_DPJBL decimal(10,3);   #对碰奖比例
	DECLARE P_JDJCS INT DEFAULT 0;   #见点奖层数

	DECLARE P_LoopCount INT DEFAULT 0;   #循环次数
	DECLARE P_SubId BIGINT;  


 	DECLARE P_Now TIMESTAMP DEFAULT UTC_TIMESTAMP();  #获取当前UTC时间

	SELECT DTFTBL,DTTXBL,DTLYJFBL,JDJBL,DPJZFDBS  FROM Shares_Config LIMIT 0,1  INTO P_Sys_DTFTBL,P_Sys_DTTXBL,P_Sys_DTLYJFBL,P_Sys_JDJBL,P_Sys_DPJZFDBS;

	SELECT Price INTO P_Invested  FROM Net_Users WHERE UserId = P_UserId  ORDER BY NetUserId DESC LIMIT 0,1 ;

	SELECT UserName,ParentUserId,PlaceArea FROM Users WHERE UserId = P_UserId INTO P_UserName,P_ParentUserId,P_PlaceArea;

	SELECT MAX(SubId) INTO P_SubId FROM Users;
	SET P_SubId =  IFNULL(P_SubId,0);
	IF( MOD(P_SubId,10) = 0 AND P_SubId > 0) THEN
		SET P_SubId =  P_SubId + 4;
	END IF;
	UPDATE Users SET SubId = P_SubId + 1 WHERE UserId = P_UserId;  #更新SubId

	WHILE (P_ParentUserId > 0 AND P_ParentUserId IS NOT NULL)  DO
		SET P_LoopCount = P_LoopCount + 1;
		
		#SELECT  P_PlaceArea;
		#更新团队人数及业绩
		IF (P_PlaceArea = 0) THEN
			UPDATE Users_Asset SET TeamNum = TeamNum + 1,TeamTurnover = TeamTurnover + P_Invested,LeftTotalTurnover = LeftTotalTurnover + P_Invested,LeftTurnoverSurplus = LeftTurnoverSurplus + P_Invested WHERE UserId = P_ParentUserId;
		ELSE
			UPDATE Users_Asset SET TeamNum = TeamNum + 1,TeamTurnover = TeamTurnover + P_Invested,RightTotalTurnover = RightTotalTurnover + P_Invested,RightTurnoverSurplus = RightTurnoverSurplus + P_Invested WHERE UserId = P_ParentUserId;
		END IF;


		#计算用户对碰奖金
		SELECT LeftTurnoverSurplus,RightTurnoverSurplus FROM Users_Asset WHERE UserId = P_ParentUserId INTO P_LeftTurnoverSurplus,P_RightTurnoverSurplus;

		SELECT ProductId,Price,IsOut FROM Net_Users WHERE UserId = P_ParentUserId  ORDER BY NetUserId DESC LIMIT 0,1  INTO P_ReProductId,P_ReInvested,P_ReIsOut;
		SET P_ReIsOut = IFNULL(P_ReIsOut,1);

		SET P_ReWeekMaxProfit = P_ReInvested * P_Sys_DPJZFDBS;  #本周可得最大收益

		SELECT SUM(Amount)  INTO P_ReTodayProfit FROM Users_Bonus WHERE UserId = P_ParentUserId AND TradeType = 1 AND BonusType = 2 AND InOrOut = 1 AND date_format(cdate,'%Y-%m-%d') = date_format(P_Now,'%Y-%m-%d');
		SET P_ReTodayProfit = IFNULL(P_ReTodayProfit,0);

		SELECT SUM(Amount)  INTO P_ReWeekProfit FROM Users_Bonus WHERE UserId = P_ParentUserId AND TradeType = 1 AND BonusType = 2 AND InOrOut = 1 AND YEARWEEK(date_format(cdate,'%Y-%m-%d')) = YEARWEEK(date_format(P_Now,'%Y-%m-%d'));
		SET P_ReWeekProfit = IFNULL(P_ReWeekProfit,0);   #本周已得收益

		SELECT DPJ,JDJCS FROM Products WHERE ProductId = P_ReProductId  INTO P_DPJBL,P_JDJCS;

		SET P_LeftTurnoverSurplus = IFNULL(P_LeftTurnoverSurplus,0);
		SET P_RightTurnoverSurplus = IFNULL(P_RightTurnoverSurplus,0);

		IF(P_LeftTurnoverSurplus > P_RightTurnoverSurplus) THEN
			SET P_UserBonus = P_RightTurnoverSurplus;
		ELSE
			SET P_UserBonus = P_LeftTurnoverSurplus;
		END IF;

		SET P_UserBonus = P_UserBonus * (P_DPJBL/100);

		IF P_ReTodayProfit  >= P_ReInvested THEN
			SET P_UserBonus = 0;
    ELSE
			IF (P_ReTodayProfit + P_UserBonus) > P_ReInvested THEN
					SET P_UserBonus = P_ReInvested - P_ReTodayProfit;
			END IF;
		END IF;


		IF P_ReWeekProfit  >= P_ReWeekMaxProfit THEN   #计算周收益是否封顶
			SET P_UserBonus = 0;
    ELSE
			IF (P_ReWeekProfit + P_UserBonus) > P_ReWeekMaxProfit THEN
					SET P_UserBonus = P_ReWeekMaxProfit - P_ReWeekProfit;
			END IF;
		END IF;


		SELECT P_UserBonus,P_ReTodayProfit, P_LeftTurnoverSurplus,P_RightTurnoverSurplus,P_ParentUserId,P_PlaceArea;


		IF(P_UserBonus > 0) THEN
			SET P_UserCashBonus = P_UserBonus * (P_Sys_DTTXBL/100);
			SET P_UserFTBonus = P_UserBonus * (P_Sys_DTFTBL/100);
			SET P_UserLYBonus = P_UserBonus * (P_Sys_DTLYJFBL/100);

			VALUES (P_ParentUserId,P_UserId,1,2,1,P_UserBonus,P_UserCashBonus,P_UserFTBonus,P_UserLYBonus,CONCAT('激活会员:',P_UserName,'获得平衡奖'),P_Now);
					
			#更新每日统计
			UPDATE Shares_Statistics SET DTBonus = DTBonus + P_UserCashBonus,DTFT = DTFT + P_UserFTBonus,DTLY = DTLY + P_UserLYBonus WHERE to_days(cdate) = to_days(P_Now);

			UPDATE Users_Asset 
			SET TotalBonus = TotalBonus + P_UserCashBonus ,BonusSurplus = BonusSurplus + P_UserCashBonus
			, DTFTJJ = DTFTJJ + P_UserFTBonus , DTFTJJYE = DTFTJJYE + P_UserFTBonus, LYJF = LYJF + P_UserLYBonus , LYJFYE = LYJFYE + P_UserLYBonus
			WHERE UserId = P_ParentUserId;

		END IF;

		#更新计算后的小区业绩
		IF(P_LeftTurnoverSurplus > P_RightTurnoverSurplus) THEN
			UPDATE Users_Asset SET LeftTurnoverSurplus = LeftTurnoverSurplus - P_RightTurnoverSurplus,RightTurnoverSurplus = 0 WHERE UserId = P_ParentUserId;
		ELSE
			UPDATE Users_Asset SET RightTurnoverSurplus = P_RightTurnoverSurplus - LeftTurnoverSurplus,LeftTurnoverSurplus = 0 WHERE UserId = P_ParentUserId;
		END IF;


		
		#计算用户见点奖
		SET P_UserBonus = P_Invested * (P_Sys_JDJBL / 100);
		#SELECT P_UserBonus,P_LoopCount;
		IF(P_UserBonus > 0 AND P_JDJCS >= P_LoopCount ) THEN
			SET P_UserCashBonus = P_UserBonus * (P_Sys_DTTXBL/100);
			SET P_UserFTBonus = P_UserBonus * (P_Sys_DTFTBL/100);
			SET P_UserLYBonus = P_UserBonus * (P_Sys_DTLYJFBL/100);

			VALUES (P_ParentUserId,P_UserId,1,4,1,P_UserBonus,P_UserCashBonus,P_UserFTBonus,P_UserLYBonus,CONCAT('激活会员:',P_UserName,'获得见点奖'),P_Now);
					
			#更新每日统计
			UPDATE Shares_Statistics SET DTBonus = DTBonus + P_UserCashBonus,DTFT = DTFT + P_UserFTBonus,DTLY = DTLY + P_UserLYBonus WHERE to_days(cdate) = to_days(P_Now);

			#更新账户余额
			UPDATE Users_Asset 
			SET TotalBonus = TotalBonus + P_UserCashBonus ,BonusSurplus = BonusSurplus + P_UserCashBonus , DTFTJJ = DTFTJJ + P_UserFTBonus , DTFTJJYE = DTFTJJYE + P_UserFTBonus, LYJF = LYJF + P_UserLYBonus , LYJFYE = LYJFYE + P_UserLYBonus
			WHERE UserId = P_ParentUserId;

		END IF;

		SET P_UserBonus = 0;
		SET P_UserCashBonus = 0;
		SET P_UserFTBonus = 0;
		SET P_UserLYBonus = 0;
		SET P_LeftTurnoverSurplus = 0;
		SET P_RightTurnoverSurplus = 0;
		SET P_ReProductId = 0;
		SET P_ReWeekProfit = 0;
		SET P_ReWeekMaxProfit = 0;
		
		SELECT ParentUserId,PlaceArea  FROM Users WHERE UserId = P_ParentUserId INTO P_ParentUserId,P_PlaceArea;
		
	END WHILE;



END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for P_UpdateTeamTurnover
-- ----------------------------
DROP PROCEDURE IF EXISTS `P_UpdateTeamTurnover`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `P_UpdateTeamTurnover`(IN P_UserId int , IN P_Amount decimal(10,3))
BEGIN

	DECLARE P_Sys_DTFTBL decimal(10,3);    #动态复投比例
	DECLARE P_Sys_DTTXBL decimal(10,3);    #动态电子积分比例
	DECLARE P_Sys_DTLYJFBL decimal(10,3);  #动态旅游积分比例
	DECLARE P_Sys_JDJBL decimal(10,3);  #见点奖比例
	DECLARE P_Sys_DPJZFDBS decimal(10,3);  #对碰奖周封顶倍数

	DECLARE P_UserName varchar(20);   #会员编号
	DECLARE P_ParentUserId BIGINT;
	#DECLARE P_Invested decimal(10,3);    #投资额
	DECLARE P_PlaceArea INT;

	DECLARE P_LeftTurnoverSurplus decimal(20,3);  #左区结余
	DECLARE P_RightTurnoverSurplus decimal(20,3);  #右区结余

	DECLARE P_UserBonus decimal(10,3) DEFAULT 0;  #用户可得总积分
	DECLARE P_UserCashBonus decimal(10,3) DEFAULT 0;  #用户可提现积分
	DECLARE P_UserFTBonus decimal(10,3) DEFAULT 0;  #用户复投积分
	DECLARE P_UserLYBonus decimal(10,3) DEFAULT 0;  #用户旅游积分
	
	DECLARE	P_ReIsOut INT;  #是否出局
	DECLARE P_ReProductId INT;  #推荐人购买的理财计划
	DECLARE P_ReInvested decimal(10,3);    #上级投资额
	DECLARE P_ReTodayProfit decimal(10,3);    #上级投资额
	DECLARE P_ReWeekProfit decimal(10,3);    #上级本周收益
	DECLARE P_ReWeekMaxProfit decimal(10,3);    #上级周最大收益

	DECLARE P_DPJBL decimal(10,3);   #对碰奖比例
	DECLARE P_JDJCS INT DEFAULT 0;   #见点奖层数

	DECLARE P_LoopCount INT DEFAULT 0;   #循环次数
 	DECLARE P_Now TIMESTAMP DEFAULT UTC_TIMESTAMP();  #获取当前UTC时间

	SELECT DTFTBL,DTTXBL,DTLYJFBL,JDJBL,DPJZFDBS  FROM Shares_Config LIMIT 0,1  INTO P_Sys_DTFTBL,P_Sys_DTTXBL,P_Sys_DTLYJFBL,P_Sys_JDJBL,P_Sys_DPJZFDBS;


	SELECT UserName,ParentUserId,PlaceArea FROM Users WHERE UserId = P_UserId INTO P_UserName,P_ParentUserId,P_PlaceArea;


	WHILE (P_ParentUserId > 0 AND P_ParentUserId IS NOT NULL)  DO
		SET P_LoopCount = P_LoopCount + 1;
		
		#SELECT  P_PlaceArea;
		#更新团队人数及业绩
		IF (P_PlaceArea = 0) THEN
			UPDATE Users_Asset SET TeamTurnover = TeamTurnover + P_Amount,LeftTotalTurnover = LeftTotalTurnover + P_Amount,LeftTurnoverSurplus = LeftTurnoverSurplus + P_Amount WHERE UserId = P_ParentUserId;
		ELSE
			UPDATE Users_Asset SET TeamTurnover = TeamTurnover + P_Amount,RightTotalTurnover = RightTotalTurnover + P_Amount,RightTurnoverSurplus = RightTurnoverSurplus + P_Amount WHERE UserId = P_ParentUserId;
		END IF;


		#计算用户对碰奖金
		SELECT LeftTurnoverSurplus,RightTurnoverSurplus FROM Users_Asset WHERE UserId = P_ParentUserId INTO P_LeftTurnoverSurplus,P_RightTurnoverSurplus;

		SELECT ProductId,Price,IsOut FROM Net_Users WHERE UserId = P_ParentUserId  ORDER BY NetUserId DESC LIMIT 0,1  INTO P_ReProductId,P_ReInvested,P_ReIsOut;
		SET P_ReIsOut = IFNULL(P_ReIsOut,1);
		SET P_ReWeekMaxProfit = P_ReInvested * P_Sys_DPJZFDBS;  #本周可得最大收益

		SELECT SUM(Amount) INTO P_ReTodayProfit FROM Users_Bonus WHERE UserId = P_ParentUserId AND TradeType = 1 AND BonusType = 2 AND InOrOut = 1 AND date_format(cdate,'%Y-%m-%d') = date_format(P_Now,'%Y-%m-%d');
		SET P_ReTodayProfit = IFNULL(P_ReTodayProfit,0);

		SELECT SUM(Amount)  INTO P_ReWeekProfit FROM Users_Bonus WHERE UserId = P_ParentUserId AND TradeType = 1 AND BonusType = 2 AND InOrOut = 1 AND YEARWEEK(date_format(cdate,'%Y-%m-%d')) = YEARWEEK(date_format(P_Now,'%Y-%m-%d'));
		SET P_ReWeekProfit = IFNULL(P_ReWeekProfit,0);   #本周已得收益

		SELECT DPJ,JDJCS FROM Products WHERE ProductId = P_ReProductId  INTO P_DPJBL,P_JDJCS;

		SET P_LeftTurnoverSurplus = IFNULL(P_LeftTurnoverSurplus,0);
		SET P_RightTurnoverSurplus = IFNULL(P_RightTurnoverSurplus,0);

		IF(P_LeftTurnoverSurplus > P_RightTurnoverSurplus) THEN
			SET P_UserBonus = P_RightTurnoverSurplus;
		ELSE
			SET P_UserBonus = P_LeftTurnoverSurplus;
		END IF;

		SET P_UserBonus = P_UserBonus * (P_DPJBL/100);

		IF P_ReTodayProfit  >= P_ReInvested THEN  #计算日收益是否封顶
			SET P_UserBonus = 0;
    ELSE
			IF (P_ReTodayProfit + P_UserBonus) > P_ReInvested THEN
					SET P_UserBonus = P_ReInvested - P_ReTodayProfit;
			END IF;
		END IF;

		IF P_ReWeekProfit  >= P_ReWeekMaxProfit THEN   #计算周收益是否封顶
			SET P_UserBonus = 0;
    ELSE
			IF (P_ReWeekProfit + P_UserBonus) > P_ReWeekMaxProfit THEN
					SET P_UserBonus = P_ReWeekMaxProfit - P_ReWeekProfit;
			END IF;
		END IF;

		SELECT P_UserBonus,P_ReTodayProfit, P_LeftTurnoverSurplus,P_RightTurnoverSurplus,P_ParentUserId,P_PlaceArea;


		IF(P_UserBonus > 0 AND P_ReIsOut = 0) THEN
			SET P_UserCashBonus = P_UserBonus * (P_Sys_DTTXBL/100);
			SET P_UserFTBonus = P_UserBonus * (P_Sys_DTFTBL/100);
			SET P_UserLYBonus = P_UserBonus * (P_Sys_DTLYJFBL/100);

			VALUES (P_ParentUserId,P_UserId,1,2,1,P_UserBonus,P_UserCashBonus,P_UserFTBonus,P_UserLYBonus,CONCAT('升级会员:',P_UserName,'获得平衡奖'),P_Now);
					
			#更新每日统计
			UPDATE Shares_Statistics SET DTBonus = DTBonus + P_UserCashBonus,DTFT = DTFT + P_UserFTBonus,DTLY = DTLY + P_UserLYBonus WHERE to_days(cdate) = to_days(P_Now);
			
			UPDATE Users_Asset 
			SET TotalBonus = TotalBonus + P_UserCashBonus ,BonusSurplus = BonusSurplus + P_UserCashBonus
			, DTFTJJ = DTFTJJ + P_UserFTBonus , DTFTJJYE = DTFTJJYE + P_UserFTBonus, LYJF = LYJF + P_UserLYBonus , LYJFYE = LYJFYE + P_UserLYBonus
			WHERE UserId = P_ParentUserId;

		END IF;

		#更新计算后的小区业绩
		IF(P_LeftTurnoverSurplus > P_RightTurnoverSurplus) THEN
			UPDATE Users_Asset SET LeftTurnoverSurplus = LeftTurnoverSurplus - P_RightTurnoverSurplus,RightTurnoverSurplus = 0 WHERE UserId = P_ParentUserId;
		ELSE
			UPDATE Users_Asset SET RightTurnoverSurplus = P_RightTurnoverSurplus - LeftTurnoverSurplus,LeftTurnoverSurplus = 0 WHERE UserId = P_ParentUserId;
		END IF;


		
		#计算用户见点奖
		SET P_UserBonus = P_Amount * (P_Sys_JDJBL / 100);
		#SELECT P_UserBonus,P_LoopCount;
		IF(P_UserBonus > 0 AND P_JDJCS >= P_LoopCount AND P_ReIsOut = 0) THEN
			SET P_UserCashBonus = P_UserBonus * (P_Sys_DTTXBL/100);
			SET P_UserFTBonus = P_UserBonus * (P_Sys_DTFTBL/100);
			SET P_UserLYBonus = P_UserBonus * (P_Sys_DTLYJFBL/100);

			VALUES (P_ParentUserId,P_UserId,1,4,1,P_UserBonus,P_UserCashBonus,P_UserFTBonus,P_UserLYBonus,CONCAT('升级会员:',P_UserName,'获得见点奖'),P_Now);
					
			#更新每日统计
			UPDATE Shares_Statistics SET DTBonus = DTBonus + P_UserCashBonus,DTFT = DTFT + P_UserFTBonus,DTLY = DTLY + P_UserLYBonus WHERE to_days(cdate) = to_days(P_Now);

			#更新账户余额
			UPDATE Users_Asset 
			SET TotalBonus = TotalBonus + P_UserCashBonus ,BonusSurplus = BonusSurplus + P_UserCashBonus , DTFTJJ = DTFTJJ + P_UserFTBonus , DTFTJJYE = DTFTJJYE + P_UserFTBonus, LYJF = LYJF + P_UserLYBonus , LYJFYE = LYJFYE + P_UserLYBonus
			WHERE UserId = P_ParentUserId;

		END IF;

		SET P_UserBonus = 0;
		SET P_UserCashBonus = 0;
		SET P_UserFTBonus = 0;
		SET P_UserLYBonus = 0;
		SET P_LeftTurnoverSurplus = 0;
		SET P_RightTurnoverSurplus = 0;
		SET P_ReProductId = 0;
		SET P_ReWeekProfit = 0;
		SET P_ReWeekMaxProfit = 0;
		
		SELECT ParentUserId,PlaceArea  FROM Users WHERE UserId = P_ParentUserId INTO P_ParentUserId,P_PlaceArea;
		
	END WHILE;



END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for P_UpdateUserCanSellShares
-- ----------------------------
DROP PROCEDURE IF EXISTS `P_UpdateUserCanSellShares`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `P_UpdateUserCanSellShares`(IN P_SellId BIGINT)
PL:BEGIN
	DECLARE P_Sys_InitialPrice decimal(10,3);  #初始价格
	DECLARE P_Sys_UnitShares BIGINT;    #单位价格股数

	DECLARE P_UserId BIGINT;
	DECLARE P_NetUserId BIGINT;
	DECLARE P_CanSellShares INT;

	DECLARE P_PriceId  INT; 
	DECLARE P_CurPrice  decimal(10,3);

	DECLARE P_ProductId INT;
	DECLARE P_LastSalePrice decimal(10,3);
	DECLARE P_LastSalePrice_D decimal(10,3); #动态最后卖出价格


	DECLARE P_DTKMGS INT;#动态可卖股数
	DECLARE P_ThisSurplus INT;#动态单条结余

	DECLARE P_SellShares BIGINT;  #挂卖股数
	DECLARE P_ShareType INT DEFAULT 2;  #股票类型

	DECLARE P_MinId BIGINT ; 
 	DECLARE P_Now TIMESTAMP DEFAULT UTC_TIMESTAMP();  #获取当前UTC时间

	SELECT InitialPrice,UnitShares  FROM Shares_Config LIMIT 0,1 INTO P_Sys_InitialPrice,P_Sys_UnitShares;

	#不存在股权价格记录则新增初始价格
	IF((SELECT COUNT(*) FROM Shares_Price) = 0) THEN
	END IF;

	SELECT MAX(Id) INTO P_PriceId FROM Shares_Price;
	SELECT Price INTO P_CurPrice FROM Shares_Price WHERE Id = P_PriceId ;
	#SELECT P_PriceId,P_CurPrice;

	SELECT UserId,Shares,ShareType FROM Shares_Sell WHERE SellId = P_SellId INTO P_UserId, P_SellShares ,P_ShareType;

	SELECT MAX(NetUserId),ProductId, LastSalePrice, LastSalePrice_D FROM Net_Users WHERE UserId = P_UserId AND IsOut = 0 INTO P_NetUserId,P_ProductId,P_LastSalePrice,P_LastSalePrice_D;
	SET P_NetUserId = IFNULL(P_NetUserId,0);
	SET P_LastSalePrice = IFNULL(P_LastSalePrice,0);
	SET P_ProductId = IFNULL(P_ProductId,0);




		SELECT P_SellShares AS SellShares,P_ShareType AS ShareType;

		SELECT MIN(ShareId) INTO P_MinId FROM Shares WHERE UserId = P_UserId  AND (Shares - OutShares) > 0;
		SET P_MinId = IFNULL(P_MinId,0);
		
		SELECT P_MinId AS ShareId;

		WHILE (P_MinId > 0 AND P_SellShares > 0) DO
			SELECT (Shares - OutShares) INTO P_CanSellShares FROM Shares WHERE ShareId = P_MinId;
			SET P_CanSellShares = IFNULL(P_CanSellShares,0);

			SELECT P_MinId AS ShareId, P_SellShares AS 可扣结余2,P_CanSellShares as CanSellShares;

			IF(P_SellShares > P_CanSellShares) THEN
				SET P_SellShares = P_SellShares - P_CanSellShares;
				UPDATE Shares SET OutShares = Shares,LastSalePrice = P_CurPrice WHERE ShareId = P_MinId;
			ELSE
				UPDATE Shares SET OutShares = OutShares + P_SellShares,LastSalePrice = P_CurPrice WHERE ShareId = P_MinId;
				SET P_SellShares = 0;
			END IF;

			SELECT MIN(ShareId) INTO P_MinId  FROM Shares WHERE UserId = P_UserId AND  ShareId > P_MinId AND (Shares - OutShares) > 0;
			SET P_MinId = IFNULL(P_MinId,0);
		END WHILE;

		
		UPDATE Net_Users SET LastSalePrice = P_CurPrice WHERE UserId = P_UserId;



	



END
;;
DELIMITER ;

