-- ----------------------------
-- Event structure for Event_Auto_Del_Expire_Images
-- ----------------------------
DROP EVENT IF EXISTS `Event_Auto_Del_Expire_Images`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` EVENT `Event_Auto_Del_Expire_Images` ON SCHEDULE EVERY 1 DAY STARTS '2017-10-01 01:01:01' ON COMPLETION NOT PRESERVE ENABLE COMMENT '每天检查一月以上图片自动删除\r\n\r\n\r\n' DO CALL P_Auto_Delete_Expire_Images
;;
DELIMITER ;
SET FOREIGN_KEY_CHECKS=1;
